                "slotted_delivery" =                 {
                    tooltip = "__How do I get an item delivered at a time convenient for me?__ \n\n While placing an order, you may select the time convenient for you from the available slots.\n\n The item will be delivered at the time you specify. We'll give you a confirmation call before the item is out for delivery.\n\n __Can I change the preferred delivery time after I have selected it at the time of placing the order?__ \n\n Yes. You may change the scheduled time of delivery. Give us a call and tell us what would be convenient for you. We'll reschedule the delivery as per your convenience.\n\n __Do I need to be available in person while taking the delivery?__ \n\n You need not be available in person at the scheduled time of delivery. You may delegate someone to accept the delivery, complete Cash on Delivery payment and sign the delivery sheet. \n\n __Are there any extra charges for scheduling the delivery at a convenient time?__ \n\n No. There are no extra charges. Just check for available slots and pick a time.";
