        safetyNotificationMoreInfo = "\n\n * We save your card number, expiry date and name on card only. We do not save CVV Nos.\n * Be assured, your card details are 100% safe with us. We use world class encryption for storing card details and our systems are PCI DSS security certified.\n * Should you wish to un-save the card, you can do so in the 'Saved Cards' section in the 'My Account' Menu.";
        savedCardFAQ = "__Why is my Card being saved on Flipkart?__\n\nIt's quicker. You can save the hassle of typing in the complete card information every time you shop at Flipkart by saving your card details. You can make your payment by selecting the saved card of your choice at checkout. While this is obviously faster, it is also very secure.\n\n__Is it safe to save my cards on Flipkart?__\n\nAbsolutely. Your card information is 100 percent safe with us. We use world class encryption technology while saving your card information on our highly secure systems. Our payment systems have passed stringent security compliance checks like PCI DSS (Payment Card Industry Data Security Standards) to ensure that your card information remains confidential at all times.\n\n__What all card information does Flipkart store?__\n\nFlipkart only stores card information when the customer selects the option. We only store your card number, cardholder name and card expiry date. We do not store your card\U2019s CVV number or the 3D Secure password.\n\n__Can I delete my saved cards?__\n\nYes, you can delete your saved cards at any given time.";
        tentativeRelease = "__What is the tentative delivery time?__\n\n Sellers generally procure and ship the items within the time specified on the product page. Business days exclude public holidays and Sundays.\n\n Estimated delivery time depends on the following factors:\n * The Seller offering the product \n * Product's availability with the Seller \n * The destination to which you want the order shipped to and the Seller's location\n\n__Why does the delivery date not correspond to the delivery timeline of X-Y business days?__ \n\n It is possible that the Seller or our courier partners observe a holiday between the day you placed your order and the date of delivery, which is based on the timelines shown on the product page. In this case, we add a day to the estimated date. Some courier partners and Sellers do not work on Sundays and this is factored in to the delivery dates. \n\n __Why does the estimated delivery time vary for each seller?__ \n\n You have probably noticed varying estimated delivery times for Sellers of the product you are interested in. Delivery times are influenced by product availability, geographic location of the Seller, your shipping destination and the courier partner's time-to-deliver to your location. \n\n Please enter your default pin code on the product page (you don't have to enter it every single time) to know more accurate delivery times on the product page itself. \n\n __Seller does not/cannot ship to my area. Why?__ \n\n Enter your pincode on the product page (you don't have to enter it every single time) to know whether the product can be delivered to your location. \n\n If you haven't provided your pincode until the checkout stage, the pincode in your last used shipping address will be used to check for serviceability. \n\n Whether your location can be serviced or not depends on:\n\n * Whether the Seller actually ships to your location \n * Legal restrictions, if any, in shipping particular products to your location \n * The availability of reliable courier partners in your location \n\n At times Sellers prefer not to ship to certain locations. This is entirely at their discretion.\n\n More answers in our <a href='/pages/shipping' target='_blank'>Shipping FAQs \U00bb</a>";
        walletFAQ = "__What is PhonePe? What payment options does PhonePe provide?__\n\n PhonePe is a new mobile payment solution. Our goal is to make digital payments so easy and safe that people never have to carry cash or cards again! You can use PhonePe as a wallet or directly make transfers through your linked bank account using UPI. It's safe, easy and instant, you have to use it to believe it!\n\n__What is UPI? What is the advantage of UPI transfers over wallets?__\n\n 'Unified Payment Interface' (UPI) is an instant payment system that allows you to transfer money directly from your bank account. The best part about UPI is that it allows you to make payments with a few clicks without the hassle of sharing bank a/c details or typing your card details, net banking password, OTP, etc. There are many advantages of UPI. The main advantage is that you don't have to block your money by loading it into a wallet. Simply link your bank account and then you can make seamless payments without having to worry about topping up a wallet, wallet spend limits or not earning interest on your money. Makes sense to use UPI for direct bank transfer rather than the plethora of wallets, doesn't it? \n\n__Can I transfer funds from PhonePe wallet? If yes, how much can be transferred?__\n\n Yes, you can transfer funds from PhonePe wallet to your bank account using the Bank Account Number and Branch IFSC Code. You can transfer a maximum of \U20b95,000 in a single transaction and a maximum of \U20b925,000 in a month.\n\n__Can I use an International phone number to activate PhonePe wallet?__\n\n No, currently PhonePe wallet is available only for domestic mobile numbers.";
