    "tooltip_zion" =     {
        bnplTnC = "\n\n 1. Available on select sellers and Flipkart Assured Products only. \n\n 2. You can settle your dues by Credit Card, Debit Card or Netbanking. \n\n 3. Failure to pay by due date may invite a late fee.";
        bnplTnCv2 = "\n\n 1. Available on products from select sellers only. \n\n 2. You can settle your dues by Credit Card, Debit Card or Netbanking. \n\n 3. Failure to pay by due date may invite a late fee.";
        certifiedBuyer = "The '__certified buyer__' badge indicates that this user has purchased this product on Flipkart.";
        changePasswordFAQ = "### Your new password must:\n\n- Be at least 4 characters in length\n\n- Not be same as your current password\n\n- Not contain common passwords.";
        deactivateFAQ = "### When you deactivate your account\n\n- You are logged out of your Flipkart Account\n\n- Your public profile on Flipkart is no longer visible\n\n- Your reviews/ratings are still visible, while your profile information is shown as \U2018unavailable\U2019 as a result of deactivation.\n\n- Your wishlist items are no longer accessible through the associated public hyperlink. Wishlist is shown as \U2018unavailable\U2019 as a result of deactivation\n\n- You will be unsubscribed from receiving promotional emails from Flipkart\n\n- Your account data is retained and is restored in case you choose to reactivate your account\n\n\n\n### How do I reactivate my Flipkart account?\n\n\n\nReactivation is easy.\n\n\n\nSimply login with your registered email id or mobile number and password combination used prior to deactivation. Your account data is fully restored. Default settings are applied and you will be subscribed to receive promotional emails from Flipkart.\n\n\nFlipkart retains your account data for you to conveniently start off from where you left, if you decide to reactivate your account.\n\n\n### Remember: Account Reactivation can be done on the Desktop version only.";
        deliverdBy = "## Shipping Charges For Flipkart Assured Items\n\n Shipping charges are calculated based on the number of units, distance and delivery date. \n\n For Plus customers, shipping charges are free.\n\n For non-Plus customers, if the total value of FAssured items is more than Rs.500, shipping charges are free.  If the total value of FAssured items is less than Rs.500, shipping charges = Rs.40 per unit\n\n\\* For faster delivery, shipping charges will be applicable";
        deliveryCharge = "## Shipping Charges For Non Flipkart Assured Items\n\n Shipping charges are calculated based on the number of units, distance and delivery date.\n\n For Plus as well as Non-Plus customers, Seller will decide shipping charges for all non-FAssured items.";
        emiFaq = "\n\n- Select your preferred EMI option at the time of payment.\n- Final EMI is calculated on the total value of your order at the time of payment.\n- The Bank charges annual interest rates according to the reducing monthly balance. In the monthly reducing cycle, the principal is reduced with every EMI and the interest is calculated on the outstanding balance.\n- The minimum order value to avail the EMI payment option is Rs 3,000.\n- This option is available only when the cart contains items from a single seller.\n- The Bank charges annual interest rates according to the reducing monthly balance. In the monthly reducing cycle, the principal is reduced with every EMI and the interest is calculated on the outstanding balance.\n- While you will not be charged a processing fee for availing Flipkart&#39;s EMI option, the interest charged by the bank shall not be refunded by Flipkart.\n- You may check with the respective bank/issuer on how a cancellation, refund or pre-closure could affect the EMI terms, and what interest charges would be levied on you for the same.\n- For select banks, the interest amount on the first EMI will be calculated from the loan booking date till the payment due date.\n- GST may also be levied by the bank as applicable.";
        emiTableFaq = "\nThis table shows different banks and the respective EMI options based on the product price. This is for indicative purposes only, your EMI payments may differ with total order amount and additional bank charges, if any.";
        fkAssuredTnC = "Flipkart Assured is the seal of Quality and Reliability. Flipkart Assured products are verified, packed with care and safely dispatched by Flipkart. With extensive quality checks, stringent seller guidelines and reliable & free shipping, Flipkart Assured guarantees a superior and hassle-free shopping experience, every time. \n\n * 6 quality Checks - Flipkart Quality guidelines ensure that extensive quality checks are done from storage to final packaging so that you get exactly what you ordered. \n * Transit Safe Packaging - Flipkart packaging guidelines ensure that your product will be safe in its journey to your doorstep. \n * Reliable Delivery - We ship your product through our most trusted courier partners, ensuring that it not only reaches you safely by the promised date but is also trackable in real-time. \n * Stringent Seller Guidelines - Flipkart Assured badge is given only to select products from our most trusted and reliable sellers to ensure your shopping outcome is perfect,very single time. \n * Free Shipping - All orders above Rs.500 are eligible for FREE shipping. \n * Faster Shipping Options - Large selection of items available with faster shipping options. We ensure you get what you want, when you want.\n\n*Available as a value added service on selected pin codes";
        "flipkart_'" = "__Flipkart Assured__\n\n Products marked with Flipkart Assured are sold by/sourced from a Seller but are quality checked, stocked, packed and shipped by Flipkart. Expedited delivery* options such as Same Day/In-a-Day Guarantee Delivery are an added bonus. <a href='/flipkart-assured' target='_blank'>Read More</a>\n\n \\* Shipments from locations where relevant permissions have been obtained.";
        giftcardFAQ = "__How do I buy / gift a Flipkart Gift Card?__\n\n 1. Enter the name and email address of the person you want to send the Flipkart Gift Card to. \n\n 2. Select the value of the card you would like to purchase, then click 'Proceed To Pay'. \n\n 3. You'll now see the payment options. You can pay by Credit Card / Debit Card / ATM Card / Netbanking. Proceed to pay using your preferred choice. If you need to make any changes to the Gift Card value, you can always click 'Edit' to modify it. \n\n 4. Complete the checkout process to receive an email with the Gift Card details.\n\n__How do I pay with a Flipkart Gift Card?__\n\n 1. Go to flipkart.com and select the items you want to purchase. When you are ready to checkout, click 'Proceed To Pay'. \n\n 2. Select the 'Pay By Gift Card' option. \n\n 3. Enter your 16-digit gift card number and the corresponding 6-digit PIN number when prompted. \n\n 4. If the Gift Card value doesn't cover your Order total, you will be prompted to select an additional payment method. \n\n NOTE: Funds will be deducted from your Flipkart Gift Card when you place your order. In case of any adjustment or cancellation at a later stage, we will credit the refund back to your Gift Card. \n\n__Does my Flipkart Gift Card expire?__\n\n All Flipkart Gift Cards expire 1 year from the date of their creation.";
        giftcardTnC = "\n\n 1. Flipkart Gift Cards (\U201cGCs\U201d or \U201cGift Cards\U201d) are issued by Qwikcilver Solutions Pvt. Ltd. ('Qwikcilver') which is a private limited company incorporated under the laws of India, and is authorized by the Reserve Bank of India ('RBI') to issue such Gift Cards. \n 2. The Gift Cards can be redeemed online against Sellers listed on www.flipkart.com or Flipkart Mobile App or Flipkart m-site ('Platform') only. \n 3. Gift Cards can be purchased on www.flipkart.com or Flipkart Mobile App using the following payment modes only - Credit Card, Debit Card and Net Banking. \n 4. Gift Cards can be redeemed by selecting the payment mode as Gift Card. \n 5. Gift Cards cannot be used to purchase other Flipkart Gift Cards or Flipkart First subscriptions. \n 6. Gift Cards cannot be used to make bulk purchases on the Platform. \n 7. If the order value exceeds the Gift Card amount, the balance must be paid by Credit Card/Debit Card/Internet Banking. The Cash on Delivery payment option cannot be used to pay the balance amount.";
        groceryDeliveryCharges = "**Why is there a shipping charge?**\n\nSupermart waives off the delivery charge for Orders over Rs 1200. For Orders under Rs 1200, a nominal delivery charge is added per order.\n\n**What is the estimated delivery time?**\n\nSupermart delivers at a convenient time as selected by you at the checkout time. Slots for delivery are available from next day.\n\n**Seller does not/cannot ship to my area. Why?**\n\nCurrently, Supermart is available only in select cities. We hope to launch in your location soon!";
        myProfileFAQ = "#### What happens when I update my email address (or mobile number)?\n\nYour login email id (or mobile number) changes, likewise. You'll receive all your account related communication on your updated email address (or mobile number).\n\n\n#### When will my Flipkart account be updated with the new email address (or mobile number)?\n\nIt happens as soon as you confirm the verification code sent to your email (or mobile) and save the changes.\n\n\n#### What happens to my existing Flipkart account when I update my email address (or mobile number)?\n\nUpdating your email address (or mobile number) doesn't invalidate your account. Your account remains fully functional. You'll continue seeing your Order history, saved information and personal details.\n\n\n#### Does my Seller account get affected when I update my email address?\n\nFlipkart has a 'single sign-on' policy. Any changes will reflect in your Seller account also.";
